import React from 'react';
import Carousel1 from '../progetto/Carousel_Progetto';
import './storia.css';
import Image1 from '../../assets/images/image1.png'
import Image2 from '../../assets/images/image2.png'
import Image3 from '../../assets/images/image3.png'

function Storia() {
  return (
    <div class="storia" id="storia">
      <div class="sinistra">
        <div class="testo-storia">
          <div class="pre-title" style={{textAlign: 'left'}}>STORIA</div>
          <div class="title" style={{textAlign: 'left'}}>La porta di Manifattura Tabacchi</div>
          <div class="paragrafo">
              Realizzato nel 1938, l'edificio è caratterizzato da un <strong>portale monumentale</strong>, decorato da <strong>bassorilievi originali</strong>. Un patrimonio evocato nell'identità stessa del progetto di rigenerazione, <strong>“Zenit”</strong>, tra le marche di sigarette originariamente prodotte in <strong>Manifattura</strong>: parola emblematica, che racchiude e tramanda lo spirito originario del luogo. 
          </div>
        </div>
      </div>
      <div class="destra">
          <Carousel1 className="carousel-2">
            <div className="contorno"></div>
          </Carousel1>
      </div>
    </div>
  );
}

export default Storia;
